import React from "react";
import { Menu } from "antd";
import {
  UserOutlined,
  VideoCameraOutlined,
  UploadOutlined,
} from "@ant-design/icons";

const CustomSider = ({ collapsed }) => {
  return (
    <Menu
      theme="dark"
      mode="inline"
      defaultSelectedKeys={["4"]}
      inlineCollapsed={collapsed}
    >
      {[
        { icon: <UserOutlined />, label: "nav 1" },
        { icon: <VideoCameraOutlined />, label: "nav 2" },
        { icon: <UploadOutlined />, label: "nav 3" },
        { icon: <UserOutlined />, label: "nav 4" },
      ].map((item, index) => (
        <Menu.Item key={String(index + 1)} icon={item.icon} title={item.label}>
          {item.label}
        </Menu.Item>
      ))}
    </Menu>
  );
};

export default CustomSider;
